import React, { useState } from 'react';
// Use '../' to go up one folder from 'component' to 'src'
import { Student } from '../types';

interface StudentListProps {
  students: Student[];
  onAddStudent: (student: Omit<Student, 'student_id'>) => Promise<void>;
  onUpdateStudent: (id: number, data: Partial<Student>) => Promise<void>;
  onDeleteStudent: (id: number) => Promise<void>;
}

// Ensure the component is exported so App.tsx can use it
export const StudentList: React.FC<StudentListProps> = ({ 
  students, 
  onAddStudent, 
  onUpdateStudent, 
  onDeleteStudent 
}) => {
  const [form, setForm] = useState({
    first_name: '',
    last_name: '',
    email: '',
    age: ''
  });

  const [editingId, setEditingId] = useState<number | null>(null);

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    if (!form.first_name || !form.last_name || !form.email || !form.age) {
      alert("Please fill in all fields");
      return;
    }

    const studentData = {
      first_name: form.first_name,
      last_name: form.last_name,
      email: form.email,
      age: Number(form.age) // Convert to number for Django
    };

    if (editingId !== null) {
      await onUpdateStudent(editingId, studentData); // UPDATE logic
      setEditingId(null);
    } else {
      await onAddStudent(studentData); // CREATE logic
    }

    setForm({ first_name: '', last_name: '', email: '', age: '' });
  };

  const handleEditClick = (student: Student) => {
    setEditingId(student.student_id);
    setForm({
      first_name: student.first_name,
      last_name: student.last_name,
      email: student.email,
      age: String(student.age)
    });
  };

  return (
    <div style={{ padding: '20px', border: '1px solid #ccc', marginBottom: '20px' }}>
      <h3>{editingId ? 'Edit Student' : 'Add New Student'}</h3>
      <form onSubmit={handleSubmit}>
        <input 
          placeholder="First Name" 
          value={form.first_name} 
          onChange={e => setForm({...form, first_name: e.target.value})} 
        />
        <input 
          placeholder="Last Name" 
          value={form.last_name} 
          onChange={e => setForm({...form, last_name: e.target.value})} 
        />
        <input 
          placeholder="Email" 
          value={form.email} 
          onChange={e => setForm({...form, email: e.target.value})} 
        />
        <input 
          placeholder="Age" 
          type="number"
          value={form.age} 
          onChange={e => setForm({...form, age: e.target.value})} 
        />
        <button type="submit" style={{ backgroundColor: editingId ? '#ffc107' : '#28a745' }}>
          {editingId ? 'Save Changes' : 'Add Student'}
        </button>
        {editingId && (
          <button type="button" onClick={() => { setEditingId(null); setForm({first_name:'', last_name:'', email:'', age:''}); }}>
            Cancel
          </button>
        )}
      </form>

      <h3>Student List</h3>
      <table border={1} style={{ width: '100%', borderCollapse: 'collapse', marginTop: '10px' }}>
        <thead>
          <tr>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Email</th>
            <th>Age</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {students.map((student) => (
            <tr key={student.student_id}>
              <td>{student.first_name}</td>
              <td>{student.last_name}</td>
              <td>{student.email}</td>
              <td>{student.age}</td>
              <td>
                <button onClick={() => handleEditClick(student)}>Edit</button>
                <button 
                  onClick={() => onDeleteStudent(student.student_id)} 
                  style={{ color: 'red', marginLeft: '5px' }}
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default StudentList;
